const rawSerials = $('Paste Serial Numbers Here').first().json.SERIAL_NUMBERS_RAW;
const serialsToCheck = rawSerials.split(/[\n,\t]+/).map(s => s.trim()).filter(s => s.length > 0);
const serialSet = new Set(serialsToCheck);
console.log('Serial numbers to check:', Array.from(serialSet));
const deviceInput = $('Split Out ID,SN and name').all();
const matchedDevices = [];
for (const item of deviceInput) {
  const deviceSerial = item.json.sn || item.json['DEVICES. sn'];
  const deviceId = item.json.id || item.json['DEVICES. id'];
  const deviceName = item.json.name || item.json['DEVICES. name'];
  if (! deviceSerial) continue;
  const cleanSerial = deviceSerial.toString().trim();
  if (serialSet.has(cleanSerial)) {
    matchedDevices. push({
      json: {
        DEVICE_TO_CHECK: deviceId,
        sn: cleanSerial,
        name: deviceName,
        group_id: item.json.group_id || item.json['DEVICES.group_id'],
        group_name: item.json.group_name || item.json['DEVICES.group_name'],
        ORG_TO_CHECK: $('Set desired org param').first().json.ORG_TO_CHECK,
        GROUP_TO_CHECK: $('Set desired org param').first().json.GROUP_TO_CHECK
      }
    });
  }
}
if (matchedDevices.length === 0) throw new Error('No matching devices found!');
return matchedDevices;

const wan2 = $json.data.response['2'];
const deviceInfo = $('Process One Device at a Time').item.json;
const resetComplete = wan2 && wan2.statusLed !== 'red';
const startTime = $('Reset Cellular WAN 2').first().json.timestamp || Date.now();
const elapsed = (Date.now() - startTime) / 1000;
const timeout = elapsed > 300;
if (resetComplete) {
  return [{json: {sn: deviceInfo.sn, name: deviceInfo.name, device_id: deviceInfo. DEVICE_TO_CHECK, status:  'SUCCESS', message: 'WAN 2 reset completed', wan2Status: wan2.statusLed, elapsed: Math.round(elapsed)}}];
} else if (timeout) {
  return [{json: {sn: deviceInfo.sn, name: deviceInfo.name, device_id: deviceInfo.DEVICE_TO_CHECK, status: 'TIMEOUT', message: 'Reset timeout after 5 minutes', wan2Status: wan2.statusLed, elapsed: Math.round(elapsed)}}];
} else {
  throw new Error('Reset in progress');
}

const allResults = $input.all();
const succeeded = [];
const failed = [];
const skipped = [];
const timedOut = [];
for (const item of allResults) {
  const result = item. json;
  switch(result. status) {
    case 'SUCCESS':  succeeded.push(result); break;
    case 'TIMEOUT': timedOut.push(result); break;
    case 'SKIPPED': skipped. push(result); break;
    default: failed.push(result);
  }
}
const summary = {
  json: {
    totalProcessed: allResults.length,
    succeeded: succeeded.length,
    failed: failed.length,
    skipped: skipped.length,
    timedOut: timedOut.length,
    succeededDevices:  succeeded.map(d => d.sn + ' (' + d.name + ')'),
    failedDevices: failed.map(d => d.sn + ' (' + d.name + ')'),
    skippedDevices: skipped.map(d => d. sn + ' (' + d.name + ')'),
    timedOutDevices: timedOut.map(d => d. sn + ' (' + d.name + ')'),
    allResults: allResults.map(r => r.json)
  }
};
console.log('WORKFLOW COMPLETE');
console.log('Total:  ' + summary.json.totalProcessed);
console.log('Succeeded: ' + summary. json.succeeded);
console.log('Failed: ' + summary.json.failed);
console.log('Skipped: ' + summary.json.skipped);
console.log('Timed Out: ' + summary.json.timedOut);
return [summary];
